module.exports = async d => {
    const code = d.command.code 
    
    const r = code.split("$serverEmojiExists").length - 1 
    
    const inside = code.split("$serverEmojiExists[")[r].split("]")[0] 
    
    return {
        code: code.replaceLast(`$serverEmojiExists[${inside}]`, d.message.guild ? d.message.guild.emojis.cache.has(inside) : "")
    }
}